:Storyline:


Joining Jools for the eighth and final show of this series are St Albans trio Friendly Fires, who
return to the studio to perform tunes from their new album Pala, the follow-up to their
Mercury-nominated debut.

Soul sista Beverley Knight is also on hand with music from her brand new album Soul UK,
which celebrates the British soul tunes she grew up with. From Dublin, James Vincent
McMorrow is making his UK TV debut, and coming in for a chat about their new album are
pop icons Blondie.

Also on the show are London four-piece Yuck, who channel the 90s sound of Sonic Youth
and Dinosaur Jnr, but in a 21st-century way, and Nathaniel Rateliff, a new young singersongwriter
from Denver, with a track from his debut album In Memory of Loss.


